import { useParams } from "react-router-dom";
const QuoteDetail = () => {
  const params = useParams();
  return (
    <Fragment>
      <h1>Quote Details</h1>
      <p>{params.quoteID}</p>
    </Fragment>
  );
};

export default QuoteDetail;
